import { ComponentStory, Meta } from '@storybook/react';
import React from 'react';
import { Flex } from './../flex';
import { Avatar } from './Avatar';
import { AvatarGroup } from './AvatarGroup';

export default {
  title: 'Demo/Avatar',
  component: Avatar,
  parameters: {
    previewTabs: { 'storybook/docs/panel': { hidden: true } },
    viewMode: 'story'
  }
} as Meta<typeof Avatar>;

const commonProps = {
  src: 'https://mui.com/static/images/avatar/1.jpg',
  alt: 'John'
};

const Template: ComponentStory<typeof Avatar> = (args) => {
  return (
    <Flex spacing={2} direction="column">
      <Avatar {...commonProps} />
      <Avatar src={<Icon icon="material-symbols:account-box" />} alt="Alt" />
      <Flex spacing={2}>
        <Avatar {...commonProps} size="small" />
        <Avatar {...commonProps} size="medium" />
        <Avatar {...commonProps} size="large" />
        <Avatar {...commonProps} size={60} />
      </Flex>
      <Flex spacing={2}>
        <Avatar {...commonProps} shape="square" />
        <Avatar {...commonProps} shape="rounded" />
        <Avatar {...commonProps} shape="circle" />
        <Avatar {...commonProps} shape={12} />
      </Flex>
      <Avatar src="/broken.jpg" alt="Alt" />
      <Avatar src="/broken.jpg" alt="Broken" color="success" />

      <AvatarGroup items={Array(6).fill({ ...commonProps })} />
    </Flex>
  );
};

export const Default = Template.bind({});
