import React from 'react';
import Box from '../box/Box';
import Button from '../button/Button';

import { Prompt } from './Prompt';

export default {
  title: 'Demo/Prompt',
  component: Prompt,
  parameters: {
    previewTabs: { 'storybook/docs/panel': { hidden: true } },
    viewMode: 'story'
  }
} as Meta<typeof Prompt>;

const Template: ComponentStory<typeof Prompt> = (args) => {
  const [open, setOpen] = React.useState(false);
  const [anchor, setAnchor] = React.useState(null);

  return (
    <>
      <Button onClick={() => setOpen(true)}>Open Prompt</Button>
      <Box sx={{ mt: 4 }}>
        <Button onClick={(ev) => setAnchor(ev.currentTarget)}>Open Prompt Here</Button>
      </Box>
      <Prompt
        open={open}
        onClose={() => setOpen(false)}
        prompt="Do you have to accept cookies?"
        onYes={() => {
          console.log('YES');
          setOpen(false);
        }}
        onNo={() => {
          console.log('NO');
          setOpen(false);
        }}
      />
      <Prompt
        open={Boolean(anchor)}
        anchorEl={anchor}
        onYes={() => {
          console.log('YES');
          setAnchor(null);
        }}
        onNo={() => {
          console.log('NO');
          setAnchor(null);
        }}
        translate={{ noBtn: 'Cancel' }}
        onClose={() => setAnchor(null)}
        prompt="Do you have to accept cookies?"
      />
    </>
  );
};

export const Default = Template.bind({});
