import React from 'react';
import { Flex } from '../flex';
import Select from './Select';

export default {
  title: 'Demo/Select',
  component: Select,
  parameters: {
    previewTabs: { 'storybook/docs/panel': { hidden: true } },
    viewMode: 'story'
  }
} as Meta<typeof Select>;

const options = [
  'Oliver Hansen',
  'Van Henry',
  'April Tucker',
  'Ralph Hubbard',
  'Omar Alexander',
  'Carlos Abbott',
  'Carlos Abbott1',
  'Carlos Abbott3',
  'Carlos Abbott2',
  'Carlos Abbott4',
  'Carlos Abbott5',
  'Carlos Abbott6',
  'Carlos Abbott7',
  'Carlos Abbott8',
  'Carlos Abbott9',
  'Carlos Abbott11',
  'Miriam Wagner',
  'Bradley Wilkerson',
  'Virginia Andrews',
  'Kelly Snyder',
  'Other'
].map((o) => ({ label: o, value: o }));

const Template: ComponentStory<typeof Select> = (args) => {
  const ref = React.useRef(null);
  const selectRef = React.useRef(null);
  const inputRef = React.useRef(null);

  return (
    <Flex justifyContent="center">
      <Select
        {...args}
        // PopoverProps={{ showBackdrop: true, isScrollLock: true }}
        placeholder="Please select an option"
        options={options}
        // onChange={(value, valArr, option) => console.log('Change: ', value, valArr, option)}
        ref={selectRef}
        inputRef={inputRef}
        autocompleteMode={{ InputProps: { debounceTime: 250 } }}
        inputProps={{ onChange: (e) => console.log(e.currentTarget.value) }}
      />
    </Flex>
  );
};

export const Default = Template.bind({});
