import { ComponentStory, Meta } from '@storybook/react';
import React from 'react';
import { Button } from '../button';
import { Sidebar } from './components/Sidebar';

export default {
  title: 'Demo/Sidebar',
  component: Sidebar,
  parameters: {
    previewTabs: { 'storybook/docs/panel': { hidden: true } },
    viewMode: 'story'
  }
} as Meta<typeof Sidebar>;

const MENUS = [
  {
    menu: [
      {
        label: <Button fullWidth>Custom</Button>,
        itemProps: {
          sx: { p: '0px !important', display: 'block !important' }
        }
      }
    ]
  },
  {
    menu: [
      {
        label: 'Home Page',
        icon: <Icon icon="ant-design:home-filled" />,
        link: '/'
      }
    ]
  },
  {
    group: 'General',
    isDivider: false,
    groupIcon: <Icon icon="icon-park-solid:general-branch" />,
    menu: [
      {
        label: 'Analytics',
        icon: <Icon icon="mdi:finance" />,
        link: '/analytic'
      },
      {
        label: 'E-Commerce',
        icon: <Icon icon="mdi:shopping" />,
        link: '/e-commerce'
      },
      {
        label: 'User',
        icon: <Icon icon="mdi:account-circle" />,
        link: '/',
        subMenu: [
          {
            label: 'Profile',
            icon: <Icon icon="mdi:account-details-outline" />,
            link: '/user/profile'
          },
          {
            label: 'Security',
            icon: <Icon icon="mdi:account-lock" />,
            link: '/user/security',
            subMenu: [
              {
                label: 'Settings',
                icon: <Icon icon="ant-design:setting-filled" />,
                link: '/settings'
              }
            ]
          }
        ]
      },
      {
        label: 'Banking',
        icon: <Icon icon="mdi:bank" />,
        link: '/bank',
        openSubMenu: true,
        subMenu: [
          {
            label: 'Profile',
            icon: <Icon icon="mdi:account-details-outline" />,
            link: '/bank/1'
          },
          {
            label: 'Security',
            icon: <Icon icon="mdi:account-lock" />,
            link: '/bank/2'
          }
        ]
      }
    ],
    defaultCollapse: false
  },
  {
    isDivider: false,
    group: 'Group',
    defaultCollapse: true,
    menu: [{ label: 'Cart', icon: 'https://picsum.photos/60/60', link: '/cart' }]
  },
  {
    isDivider: false,
    group: 'Others',
    defaultCollapse: true,
    menu: [{ label: 'Cart', icon: 'https://picsum.photos/60/60', link: '/cart' }]
  }
];

const Template: ComponentStory<typeof Sidebar> = (args) => {
  React.useEffect(() => {
    document.body.style.minHeight = '100vh';
    document.body.style.padding = '0px';
    document.body.style.background = 'var(--cads-palette-background-paper)';
  });
  const [pathname, setPathname] = React.useState('/settings');
  const [isSmall, setIsSmall] = React.useState(false);

  React.useEffect(() => {
    setIsSmall(Boolean(args.isSmall));
  }, [args.isSmall]);

  return (
    <>
      <Sidebar
        homeTitle="CADS UI Kits"
        homeLogo={<Icon icon="akar-icons:react-fill" />}
        howActiveLink={(l) => l === pathname}
        onNavigate={(l) => {
          // console.log(l);
          setPathname(l);
        }}
        onToggleIconClick={() => setIsSmall((pre) => !pre)}
        {...args}
        isSmall={isSmall}
        items={MENUS}
      />
    </>
  );
};

export const Default = Template.bind({});
