import { ComponentStory, Meta } from '@storybook/react';
import React from 'react';
import { Flex } from '../flex';
import TreeSelect, { TSLOption } from './TreeSelect';

const MENU: TSLOption[] = [
  {
    label: 'documents',
    value: 'docs',
    subOptions: [
      { label: 'note-1.txt', value: 'note-1.txt' },
      { label: 'note-2.txt', value: 'note-2.txt' },
      {
        label: 'reports',
        value: 'reports',
        subOptions: [
          { label: 'report-1.xlsx', value: 'report-1.xlsx' },
          { label: 'report-2.xlsx', value: 'report-2.xlsx' },
          { label: 'report-3.xlsx', value: 'report-3.xlsx' }
        ]
      }
    ]
  },
  {
    label: 'www',
    value: 'www',
    subOptions: [
      { label: 'index.html', value: 'index.html' },
      { label: 'index.css', value: 'index.css' },
      { label: 'index.js', value: 'index.js' }
    ]
  }
  // {
  //   label: 'download',
  //   value: 'download',
  //   subOptions: [{ label: 'download 1', value: 'download-1', subOptions: [{ value: 'temp.jsx', label: 'temp.jsx' }] }]
  // }
];

export default {
  title: 'Demo/Tree Select',
  component: TreeSelect,
  parameters: {
    previewTabs: { 'storybook/docs/panel': { hidden: true } },
    viewMode: 'story'
  }
} as Meta<typeof TreeSelect>;

const Template: ComponentStory<typeof TreeSelect> = (args) => {
  const [val, setVal] = React.useState();

  return (
    <Flex justifyContent="flex-start" alignItems="flex-start">
      <TreeSelect
        {...args}
        PopoverProps={{
          sx: {
            '& .cads-list-item': {
              __mb: 2
            }
          },
          isScrollLock: true
        }}
        // onChange={(val, valArr: any, option) => {
        //   console.log(val, valArr, option);
        //   setVal(val);
        // }}
        // value={val}
        renderOption={(option) => (
          <Flex spacing={2}>
            {option.subOptions?.length === 0 ? (
              <Icon style={{ color: 'var(--cads-palette-text-secondary)' }} icon="ic:baseline-insert-drive-file" />
            ) : (
              <Icon style={{ color: 'var(--cads-palette-text-secondary)' }} icon="material-symbols:folder-rounded" />
            )}
            <span>{option.label}</span>
          </Flex>
        )}
        options={MENU}
        limitTags={2}
        // PopoverProps={{ showBackdrop: true, isScrollLock: true, placement: 'bottom-end' }}
        placeholder="Place select a option"
      />
      <div style={{ height: '100vh' }}></div>
    </Flex>
  );
};

export const Default = Template.bind({});
